There exists no form of thought or activity that is not enslaved by materialism. Our hostility is as great towards Capitalism, as against Marxism. Capitalism, by means of poverty or prosperity, reduces the people to a state of servitude incompatible with the dignity of man. It directs whole classes and one's whole personality toward the acquisition of money: that's the only desire that fills the modern soul. Marxism is the rebellious son of Capitalism from which it received its faith in matter.<br />
 <br />
We believe not in Capitalism which creates class struggle, nor do we believe in Marxism that exploits it; neither in directors who enrich themselves from peoples labour, neither in politicians who make career out of its resentment, neither in conservative blindness, neither in demagogue impudence, neither in egoism, neither in cowardice, neither in left or right&#33;
